import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Footer = () => {
    return (
        <footer>
            <Contaner>
                <Row>
                    <Col className='ext-center py-3'> Copyright &copy; Poshak </Col>
                </Row>
            </Contaner>
            Footer
        </footer>
    )
}

export default Footer
